const e=JSON.parse('{"key":"v-6ae5af90","path":"/lc540.html","title":"540. 有序数组中的单一元素","lang":"en-US","frontmatter":{"tag":"二分"},"headers":[],"git":{"createdTime":1731218622000,"updatedTime":1731218622000,"contributors":[{"name":"HouShengming","email":"18865290907@163.com","commits":1}]},"readingTime":{"minutes":0.8,"words":239},"filePathRelative":"lc540.md","localizedDate":"November 10, 2024","excerpt":"<h1> 540. 有序数组中的单一元素</h1>\\n<p>给你一个仅由整数组成的有序数组，其中每个元素都会出现两次，唯有一个数只会出现一次。</p>\\n<p>请你找出并返回只出现一次的那个数。</p>\\n<p>你设计的解决方案必须满足 <code>O(log n)</code> 时间复杂度和 <code>O(1)</code> 空间复杂度。</p>\\n<p><strong>示例 1:</strong></p>\\n<pre><code>输入: nums = [1,1,2,3,3,4,4,8,8]\\n输出: 2\\n</code></pre>\\n<p><strong>示例 2:</strong></p>\\n<pre><code>输入: nums =  [3,3,7,7,10,11,11]\\n输出: 10\\n</code></pre>"}');export{e as data};
